import React  from "react";
import { Navbar } from "./components/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";

const App: React.FunctionComponent = () => {

  return (
    <>
      <Navbar />
      <div className="container">
        <Routes>
          <Route />
          <Route />
        </Routes>
      </div>
    </>
  );
};

export default App;
